import Pokemon from './Pokemon';
import pokemons from './data';
import React, { Component } from 'react';

class Pokedex extends  Component {

    render() {
        const {pokemon} = this.props;

        return (
            <div>
                <Pokemon 
                name={pokemon.name} 
                type={pokemon.type} 
                averageWeight={pokemon.averageWeight}
                image={pokemon.image}/>
            </div>
        )
    }
}

export default Pokedex;
